import s from './profile.module.css'
import CommentBlock from '../Comment/comment.jsx'
import FriendList from './FriendList/friendList.jsx'
import UsersInfo from './UsersInfo/usersInfo.jsx'

const ProfilePage = (props) =>{

  let comments = props.comments.slice(0).reverse().map((comment)=>{
     return (<CommentBlock dispatch={props.dispatch} comment={comment} staticInfo={comment.staticInfo} dynamicInfo={comment.dynamicInfo}/>)
   });

  return (
    <div className={s.profile}>
      <div className={s.photo} />
      <UsersInfo username={props.user.usersInfo.name}/>
      <div className={s.comment_section}>
        User's Comments
        <div className={s.comments}>
          {comments}
        </div>
      </div>
      <FriendList/>
    </div>
  );
}

export default ProfilePage;
